import React, { 
  Component,  
} 
from 'react';

import {
  Column,
  Grid,
  Row,
  Container
} 
from "./components/bootstrap";

class App extends Component {
  render() {
    return (
      <Container fluid bg-dark bg>
        <Grid>
            <Row>
              <Column>
                <h1 className="text-center"> abra </h1>
              </Column>
              <Column>
                <h1 className="text-center"> ibra </h1>
              </Column>
            </Row>
          </Grid>
      </Container>
    );
  }
}

export default App;
